    false,nt"url": null,nt"notes": "This annual narrative report for Cape Romain
    National Wildlife Refuge summarizes Refuge activities during the 1996 calendar year.
     The report begins with a summary of the yearu2019s highlights and climatic conditions.
     Land acquisition is covered next.  The planning section discusses research and
    investigations.  Refuge administration is outlined; information about personnel,
    youth programs, volunteer programs, funding sources, safety, and technical assistance
    is given.  Habitat management is also covered.  Subjects include wetlands, forests,
    fire management, pest control, wilderness, and special areas.  The wildlife section
    of the report discusses wildlife diversity, endangered species, threatened species,
    waterfowl, marsh birds, water birds, shorebirds, raptors, game mammals, marine mammals,
    fisheries resources, scientific collections, and animal control.  The public uses
    of the refuge described in this report include outdoor classrooms, interpretive
    trails, hunting, fishing, wildlife observation, law enforcement, cooperating associations,
    and concessions.  The equipment and facilities section of the report provides information
    about new construction, rehabilitation, major maintenance, and equipment utilization/replacement.
     Cooperative programs, economic uses of the Refuge, and items of interest are provided
    at the end; refuge brochures are attached.",nt"license_title": "License Not
